(defn find-10pc-generization-error [algorithm X Y n]
  (let [X_test (r/sample-rand-int [10 n] 2)
        Y_test (matrix (submatrix X 0 10 0 1)) 
        Y_hat (algorithm X Y X_test Y_test)]
    
       (if (< (esum (abs (sub Y_test Y_hat))) 8) true)))
