;; @@
; funtion with takes another function and tries to do it repeadilty until it succeds 9/10 times, the it moves onto the next value.





(defn simulate-sample-complexity [algorithm]
  (for [n (range 1 10)]
    (do 
      (def pass? false)
    	(for [m (range 1 10) :while (= pass? false)]
    		(let [X (r/sample-rand-int [m n] 2)
            	  Y (matrix (submatrix X 0 m 0 1))]
           		 (if (= algorithm true) (def pass? true))
            	 (* m n)		
             
             )
      )))
         
           
         
         
         )
  
  
  
